import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithub } from "@fortawesome/free-brands-svg-icons";
import doctorClinicProject from "../images/Screen Shot 2022-09-07 at 7.37.54 PM.png";

const Projects = () => {
  return (
    <div>
      <h1 className="text-4xl dark:text-white text-black font-bold font-merriweather text-center py-10">
        Projects
      </h1>

      <div className="w-2/3 dark:bg-zinc-900 bg-zinc-200 dark:text-white text-black font-merriweather text-center m-auto p-10 rounded-3xl">
        <img
          src={doctorClinicProject}
          alt="Project demonstration: terminal with project's command calls"
          className="w-1/10"
        />
        <div>
          <h1 className="text-2xl dark:text-white text-black pb-5">
            Doctor Clinic Management System
          </h1>
          <h1 className="text-sm dark:text-white text-black">
            A program created to manage doctor clinics, including a login system
            and user to user interactions. This program makes it easy for
            patients to book appointments and view prescriptions, for doctors to
            create patient prescriptions and reports and organize their
            schedules, and for secretaries to book appointments for patients and
            view a patient's prescriptions.
          </h1>
        </div>
      </div>
    </div>
  );
};

export default Projects;
